fn transform64(lmid: [u128; STATE_LENGTH], hmid: [u128; STATE_LENGTH]) -> ([u128; STATE_LENGTH*2], [u128; STATE_LENGTH*2]) {

    // side A/B true[from:a, to:b], false:[from:b, to:a]
    let mut side = true;

    let mut lmid_side_a: [u128; STATE_LENGTH] = lmid;
    let mut hmid_side_a: [u128; STATE_LENGTH] = hmid;

    let mut lmid_side_b: [u128; STATE_LENGTH] = [0; STATE_LENGTH];
    let mut hmid_side_b: [u128; STATE_LENGTH] = [0; STATE_LENGTH];
 
    for _round in 0..26 {
        for j in 0..STATE_LENGTH {

            let lfrom;
            let hfrom;
            if side {
                // from:A, to:B
                lfrom = &lmid_side_a;
                hfrom = &hmid_side_a;
            } else {
                // from:B, to:A
                lfrom = &lmid_side_b;
                hfrom = &hmid_side_b;
            }

            let t1 = INDICES[j];
            let t2 = INDICES[j + 1];

            let alpha = lfrom[t1];
            let beta = hfrom[t1];
            let gamma = hfrom[t2];

            let delta = (alpha | (!gamma)) & (lfrom[t2] ^ beta);

            // ~delta
            let lto = (!delta) & H_BITS_128;

            // (alpha ^ gamma) | delta
            let hto = (alpha ^ gamma) | delta;

            if side {
                // from:A, to:B
                lmid_side_b[j] = lto;
                hmid_side_b[j] = hto;
            } else {
                // from:B, to:A
                lmid_side_a[j] = lto;
                hmid_side_a[j] = hto;
            }
        }

        side = !side;
    }

    if !side {
        panic!("side is B(false)");
    }

    let lfrom = &lmid_side_a;
    let hfrom = &hmid_side_a;

    for k in 0..HASH_LENGTH {
        let t1 = INDICES[k];
        let t2 = INDICES[k + 1];

        let alpha = lfrom[t1];
        let beta = hfrom[t1];
        let gamma = hfrom[t2];

        let delta = (alpha | (!gamma)) & (lfrom[t2] ^ beta);

        // ~delta
        lmid_side_b[k] = (!delta) & H_BITS_128;

        // (alpha ^ gamma) | delta
        hmid_side_b[k] = (alpha ^ gamma) | delta;
    }

    let mut lmid_result: [u128; STATE_LENGTH*2] = [0; STATE_LENGTH*2];
    let mut hmid_result: [u128; STATE_LENGTH*2] = [0; STATE_LENGTH*2];

    for count in 0..STATE_LENGTH {
        lmid_result[count] = lmid_side_a[count];
        hmid_result[count] = hmid_side_a[count];

        lmid_result[STATE_LENGTH + count] = lmid_side_b[count];
        hmid_result[STATE_LENGTH + count] = hmid_side_b[count];
    }

    (lmid_result, hmid_result)
}


fn incr(lmid: [u128; STATE_LENGTH], hmid: [u128; STATE_LENGTH]) -> bool {

    let mut c: [u64; 2] = [0; 2];

    let mut lmid_copy: [u128; STATE_LENGTH] = lmid;
    let mut hmid_copy: [u128; STATE_LENGTH] = hmid;

    let mut i = 5;
    loop {
        if HASH_LENGTH <= i || ( i != 5 && c[0] == 0) {
            break;
        }

        let low = lmid_copy[i];
        let high = hmid_copy[i];

        lmid_copy[i] = high ^ low;
        hmid_copy[i] = low;

        let carry = (!low) & high;

        // TODO safe?
        c = unsafe { std::mem::transmute::<u128, [u64; 2]>(carry) };

        i += 1;
    }

    i == HASH_LENGTH
}


fn incrN128(n: i64, lmid: [u128; STATE_LENGTH], hmid: [u128; STATE_LENGTH]) -> ([u128; STATE_LENGTH], [u128; STATE_LENGTH]) {
    let mut c: [u64; 2] = [1; 2];

    let mut lmid_copy: [u128; STATE_LENGTH] = lmid;
    let mut hmid_copy: [u128; STATE_LENGTH] = hmid;

    for _j in 0..n {
        let mut i = HASH_LENGTH - 7;
        loop {
            if i >= HASH_LENGTH || c[0] == 0 {
                break;
            }

            let low = lmid_copy[i];
            let high = hmid_copy[i];

            lmid_copy[i] = high ^ low;
            hmid_copy[i] = low;

            let carry = (!low) & high;

            // TODO safe?
            c = unsafe { std::mem::transmute::<u128, [u64; 2]>(carry) };

            i += 1;
        }
    }

    (lmid_copy, hmid_copy)
}


fn para(mid: [i8; STATE_LENGTH]) -> ([u128; STATE_LENGTH], [u128; STATE_LENGTH]) {

    let mut lmid: [u128; STATE_LENGTH] = [0; STATE_LENGTH];
    let mut hmid: [u128; STATE_LENGTH] = [0; STATE_LENGTH];

    const H_BITS_128: u128 = 0xFFFFFFFFFFFFFFFF_FFFFFFFFFFFFFFFF;
    const L_BITS_128: u128 = 0x0000000000000000_0000000000000000;
    
    for count in 0..STATE_LENGTH {
        if mid[count] == 0 {
            // _mm_set_epi64x
            // int64 b, int64 a -> int128 a_b
            lmid[count] = H_BITS_128;
            hmid[count] = H_BITS_128;
        } else if mid[count] == 1 {
            lmid[count] = L_BITS_128;
            hmid[count] = H_BITS_128;
        } else if mid[count] == -1 {
            lmid[count] = H_BITS_128;
            hmid[count] = L_BITS_128;
        }
    }

    (lmid, hmid)
}


